from lesson1.task_E import calc_profit


def test_calc_profit():
    assert calc_profit(21, 108, 1) == 216

    assert calc_profit(5, 12, 4) == -1

    assert calc_profit(52913363, 66141703, 59523) == -1

    assert calc_profit(1, 5, 4) == 10000

    assert calc_profit(1, 17, 4) == 17000

    assert calc_profit(23, 17, 5) == 2380000
    assert 2380000 % 17 == 0

    assert calc_profit(37, 117, 1) == -1
    assert calc_profit(37, 17, 1) == 374

    assert calc_profit(101, 77, 3) == -1
    assert calc_profit(1, 1000, 3) == -1

    assert calc_profit(29420920, 98069736, 69929) == ""
